package ntou.github.related;

import ntou.github.related.bean.GithubNode;
import ntou.github.related.bean.SwaggerNode;
import ntou.github.related.repository.GithubNodeRepository;
import ntou.github.related.repository.SwaggerNodeRepository;
import ntou.github.related.web.WebController;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.test.context.junit4.SpringRunner;

import java.io.File;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Paths;
import java.util.ArrayList;

@RunWith(SpringRunner.class)
@SpringBootTest
public class FindSameRepoInMultipleAPI {

    Logger log = LoggerFactory.getLogger(FindSameRepoInMultipleAPI.class);

    @Autowired
    GithubNodeRepository githubNodeRepository;

    @Autowired
    SwaggerNodeRepository swaggerNodeRepository;

    @Autowired
    WebController webController;

    //@Test
    public void haveMoreThanTwoAPI() {
        ArrayList<String> result = new ArrayList<>();

        for(GithubNode targetGithubNode : githubNodeRepository.findAll()) {
            String repoFullName = targetGithubNode.getRepoFullName();
            Long targetID = targetGithubNode.getId();

            if(repoFullName.equals("Pudding124/DataClassification")) {
                log.info("avoid my repo");
                continue;
            }
            log.info("RepoFullName :{}", repoFullName);

            for(GithubNode compareGithubNode : githubNodeRepository.findBySameGitHubNode(repoFullName)) {
                // judge not same github node
                if(targetID.compareTo(compareGithubNode.getId()) != 0) {
                    // compare the github repo name
                    if(repoFullName.equals(compareGithubNode.getRepoFullName())) {
                        if(!result.contains(repoFullName)) {
                            log.info("save repo FullName :{}", repoFullName);
                            result.add(repoFullName);
                        }
                    }
                }
            }
        }
        log.info("Result :{}", result);
    }

    @Test
    public void haveMoreThanTwoOAS() {
        ArrayList<String> result = new ArrayList<>();

        File sDocFolder = new File("./src/main/resources/finishsearch");
        for (String serviceFile : sDocFolder.list()) {
            log.info("parse swagger guru file: {}", serviceFile);
            try {
                // do something
                String document = readLocalSwagger("./src/main/resources/finishsearch/" + serviceFile);
                if(document != null){
                    String title = webController.parseSwaggerTitle(document);

                    for(GithubNode targetGithubNode : swaggerNodeRepository.findGitHubNodeBySwaggerNode(title)) {
                        String repoFullName = targetGithubNode.getRepoFullName();
                        Long targetID = targetGithubNode.getId();

                        if (repoFullName.equals("Pudding124/DataClassification")) {
                            log.info("avoid my repo");
                            continue;
                        }
                        log.info("RepoFullName :{}", repoFullName);

                        for(SwaggerNode targetSwaggerNode : githubNodeRepository.findSwaggerNodeByRepo(repoFullName)) {
                            Long targetSwaggerID = targetSwaggerNode.getId();

                            for(GithubNode compareGithubNode : githubNodeRepository.findBySameGitHubNode(repoFullName)) {
                                // judge not same github node
                                if(targetID.compareTo(compareGithubNode.getId()) != 0) {
                                    // compare the github repo name
                                    if(repoFullName.equals(compareGithubNode.getRepoFullName())) {
                                        // judge not same swagger doc
                                        for(SwaggerNode compareSwaggerNode : githubNodeRepository.findSwaggerNodeByRepo(repoFullName)) {
                                            // compare not same swagger doc
                                            if(targetSwaggerID.compareTo(compareSwaggerNode.getId()) != 0) {
                                                if(!result.contains(repoFullName)) {
                                                    log.info("save repo FullName :{}", repoFullName);
                                                    result.add(repoFullName);
                                                }
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }else{
                    log.error("error read swagger local file: {}", serviceFile);
                }

            } catch (Exception e) {
                log.error("error parsing on {}", serviceFile);
            }
        }

        log.info("Result :{}", result);
    }

    // For testing
    public String readLocalSwagger(String path) {
        try {
            byte[] encoded = Files.readAllBytes(Paths.get(path));
            return new String(encoded, "UTF-8");
        } catch (IOException e) {
            System.err.println("read swagger error");
            return null;
        }

    }
}
